import React from 'react';

function Entry(props) {
	return(
		<div>
		<div>
			<h1>
				<span>emojipedia</span>
			</h1>
		</div>

		<div className="term">
			<dt>
		        <span className="emoji" role="img" aria-label="Tense Biceps">
		          {props.data.emoji}
		        </span>
				<span>{props.data.name}</span>
			</dt>
			<dd>{props.data.meaning}</dd>
		</div>
		</div>
	)
}

export default Entry;
